import React from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import { withRouter } from 'react-router-dom';
import './UserDetails.scss';
import { getActionsFormate } from '../../utils/common';
import pageConfig from '../../utils/pageConfig';
import { FOOTPRINTS_COMPONENTS } from '../../config';


class UserDetails extends React.Component{
  constructor(props){
    super(props);
  }

  componentDidMount(){
    const { makeCall, page } = this.props;
    const { components } = pageConfig[page];
    components &&
      components.map(comp => {
        const type = FOOTPRINTS_COMPONENTS[comp].job.PAGE_DATA;
        const { params } = this.props.match;
        makeCall(type, { ...params });
        return true;
      });
  }

  render(){
    const { data } = this.props;
    const { email } = data;
    const fullName = `${data.first_name} ${data.last_name}`;
    return (
      <div className="user-details">
        <div className="user-name">{fullName}</div>
        <div className="user-email"> {email}</div>
      </div>
    );
  }
}

UserDetails.propTypes = {
  data: PropTypes.oneOfType([PropTypes.array, PropTypes.object]).isRequired
};

const mapStateToProps = (state) =>{

}
const mapDispatchToProps = dispatch => {
  return {
    makeCall: (type, data) => {
      dispatch(getActionsFormate(type, data));
    }
  };
}
export default withRouter(
  connect(
    mapStateToProps,
    mapDispatchToProps
  )(UserDetails)
);
